PREFIX ns: <https://schema.coypu.org/global#>
PREFIX wpi: <https://schema.coypu.org/world-port-index#>
SELECT DISTINCT ?port ?portName ?latitude
WHERE {
  ?port 
    a wpi:CoastalPort;
    ns:hasPortName ?portName;
    ns:hasLatitude ?latitude.
  FILTER (?latitude = (
    SELECT (MAX(?lat) AS ?maxLat)
    WHERE {
      ?port 
        a wpi:CoastalPort;
        ns:hasLatitude ?lat.
    }
  ))
}
LIMIT 1

